css:
@-moz-document domain("augoeides.world") {
body {
    padding-bottom: 40px;
    color:  #1d1d1d;
    background-color:  #1d1d1d;
}
a {
    color: #8e44ad;
}
.navbar-default .navbar-nav > li > a {
    color: #8e44ad;
}
.navbar-brand, .navbar-nav>li>a {
    text-shadow: 0 1px 0 rgba(0, 0, 0, 0.25);
}
element.style {
    display: block;
    width: 0%;
    opacity: 1;
}
footer {
    padding-top: 30px;
    color: #000000;
}
@media (min-width: 1200px)
    {.container {
    width: 1000px;
                                        }
                                        }
}
